column8:
ブルーLED採用のオンダッシュボードタイプのフラッシュライト です。発光パターンは18通りから選択可能。DC11V～30V の車輌へ使用可能です。電源はシガーソケットにプラグオンするだ け。便利なパイロットランプ点灯電源スイッチ付。<br><br>●発光タイプ：6LED内蔵の6ストレート発光タイプ<br><br>※一般公道走行時のご使用はお控え下さい。<br><br>汎用品：DC11V～30V車<br><br>競技専用パーツ<br><br>電装系 | 電装系その他<tr><td colspan="2">
